import { BrowserRouter,Switch,Route } from 'react-router-dom';
import './App.css';
import About from './Components/AboutUs/About';
import Blog from './Components/Blog/Blog';
import Header from './Components/Header/Header';
import Home from './Components/Home/Home';
import Services from './Components/Services/Services';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header></Header>
      <Switch>
        <Route exact path='/'>
          <Home></Home>
        </Route>
        <Route  path='/home'>
          <Home></Home>
        </Route>
        <Route  path='/Services'>
        <Services></Services>
        </Route>
        <Route  path='/Blog'>
          <Blog></Blog>
        </Route>
        <Route  path='/Blog'>
        <About></About>
        </Route>

      </Switch>
      </BrowserRouter>





    </div>
  );
}

export default App;
